import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import ContactContext from './context/contact/contactContext';

ReactDOM.render(
  <React.StrictMode>
    <ContactContext>
      <App />
    </ContactContext>
  </React.StrictMode>,
  document.getElementById('root')
);
